customerRequirement.contractPriceFormula:
Формула цены и максимальное значение цены контракта в соответствии с требованиями ч.2 ст.34 Федерального закона от 05.04.2013 N 44-ФЗ "О контрактной системе в сфере закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд" и Постановления Правительства РФ от 13.01.2014 N 19 "Об установлении случаев, в которых при заключении контракта в документации о закупке указываются формула цены и максимальное значение цены контракта":
ЦК=∑_(i=1)^n▒〖Цi*Vi〗
где:
ЦК – цена Контракта, определённая с использованием настоящей формулы, которая не может превышать максимальное значение цены контракта (ЦК ⩽ЦКmax);
Цi – отпускная цена Поставщика за единицу поставляемого Товара в месяце (периоде) поставки, указываемая Поставщиком в товарной накладной;
Vi –  объём поставляемого Товара в месяце (периоде) поставки;
i– начальное значение (индекс суммирования), который равен значению суммируемых величин (Цi ∙ Vi) за 1 месяц поставки Товара;
n– конечное значение (диапазон суммирования), которое равно значению суммируемых величин за количество месяцев (периода) поставки, используемому при расчёте.
